import React, {Component} from "react"
import { connect } from "react-redux"

const FavComics = props => {
    console.log("fav comics props", props)
    const favComics = props.currentUser.comedians.map
    return (
        <>
        <h1>fav comics</h1>
        {props.currentUser.comedians == 0 ? 
            <p>no favorited comedians</p>
        : 
            <h3>{favComics[0].name}</h3>
        }

        </>
    )
}
const msp = state => {
    return {currentUser: state.currentUser}
}
export default connect(msp)(FavComics)
